column8:
肌本来のすべすべしたツヤのあるお肌状態に導く。カタツムリ高純度化粧水。<br>
<br>
お肌にぐんぐん染み込んで、みずみずしくて、滑らかなお肌へ！<br>
カタツムリ粘液エキス成分が有害環境から疲れた肌にやさしく、肌本来の状態に導きます。<br>
<br>
<br>
■カタツムリ粘液濾過物（肌のサイクルアップ・うるおい・弾力）<br>
＜カタツムリエキスに含まれる成分＞<br>
１．プロテアーゼ（タンパク質分解酵素）<br>
古くなった角質・垢のタンパク質を分解し、汚れや老廃物を取り除くことにより、<br>
すべすべでなめらかなお肌に！<br>
２．フィブリン溶解酵素<br>
血行の流れや循環をサポートにし、お肌に必要な酵素と栄養を行き渡らせます。<br>
３．コンドロイチン（ミュシン）<br>
肌水分を維持し、うるおいを与え、有害物質からお肌を守ります。<br>
４．自然抗生物質 アラントイン、コラーゲン<br>
お肌のハリと弾力性を維持し、健康で若々しいお肌に。<br>
５．グリコール酸、複数のビタミン類<br>
ピーリング作用で、古くなった角質をケアし、ターンオーバーサイクルをサポートします。<br>
<br>
■ＥＧＦ（エイジングケア・ターンオーバー促進）<br>
■プラセンタたんぱく質（肌のキメ・弾力・ツヤ）<br>
■白キクラゲ抽出物（毛穴ケア・皮脂バランス）<br>
<br>
使い方は？<br>
洗顔後、コットンまたは手のひらに取り、適量を肌のキメにそって塗り伸ばし、軽く叩いて馴染ませます。<br>
<br>
成　分<br>
カタツムリ分泌液・水・BG, 1,2－ヘキサンジオール、水溶性コラーゲン、 プラセンタエキス、ヒトオルゴペプチドー１、シロキクラゲエキス、コメエキス、サンショウ果実エキス、ウスニアバルバタエキス、ヒドロキシエチルセルロース、エタノール、 ノノキシノール－１２、EDTAー２Na,香料<br>
<br>
内容量：150ml
<br>
<br>
JAN:4580268268153<br>
